import{_ as i,c as s,o as n,ap as o,aq as e,ar as r,as as t,at as l,au as h,av as d,aw as m,ax as g,ay as c,az as u,aA as p}from"./chunks/framework.DiJbvxCq.js";const P=JSON.parse('{"title":"Frequently Asked Questions (FAQ)","description":"","frontmatter":{},"headers":[],"relativePath":"faq.md","filePath":"faq.md","lastUpdated":1768854468000}'),x={name:"faq.md"};function y(w,a,v,f,b,k){return n(),s("div",null,[...a[0]||(a[0]=[o('<h1 id="frequently-asked-questions-faq" tabindex="-1">Frequently Asked Questions (FAQ) <a class="header-anchor" href="#frequently-asked-questions-faq" aria-label="Permalink to “Frequently Asked Questions (FAQ)”">​</a></h1><h2 id="general" tabindex="-1">General <a class="header-anchor" href="#general" aria-label="Permalink to “General”">​</a></h2><h3 id="how-do-i-find-what-version-of-paperback-i-am-using" tabindex="-1">How do I find what version of Paperback I am using? <a class="header-anchor" href="#how-do-i-find-what-version-of-paperback-i-am-using" aria-label="Permalink to “How do I find what version of Paperback I am using?”">​</a></h3><details><summary>Answer</summary><ul><li>Tap the <em>cog icon</em> to open <strong><em>Settings</em></strong>. <ul><li>iOS: </li><li>macOS/iPadOS:</li></ul></li></ul><div align="center"><img src="'+e+'" alt="Settings Cog (macOS/iPadOS)" width="300"></div><ul><li>The version number can be found under the Paperback logo and name (e.g. v0.9-r21).</li></ul><div align="center"><img src="'+r+'" alt="Paperback Version" width="300"></div></details><h3 id="how-do-i-find-an-extension-s-version" tabindex="-1">How do I find an extension&#39;s version? <a class="header-anchor" href="#how-do-i-find-an-extension-s-version" aria-label="Permalink to “How do I find an extension&#39;s version?”">​</a></h3><details><summary>Answer</summary><ul><li>Tap the <em>cog icon</em> → <strong><em>Settings</em></strong> → <strong><em>Extensions</em></strong>. <ul><li>iOS: </li><li>macOS/iPadOS:</li></ul></li></ul><div align="center"><img src="'+e+'" alt="Settings Cog (macOS/iPadOS)" width="300"></div><div align="center"><img src="'+t+'" alt="Settings - Extensions" width="300"></div><ul><li>The extension&#39;s version number will be displayed underneath its name.</li></ul><div align="center"><img src="'+l+'" alt="Extension Version" width="300"></div></details><h3 id="why-do-i-have-blurred-covers-with-a-letter-u-m-or-a-on-them" tabindex="-1">Why do I have blurred covers with a letter (U, M or A) on them? <a class="header-anchor" href="#why-do-i-have-blurred-covers-with-a-letter-u-m-or-a-on-them" aria-label="Permalink to “Why do I have blurred covers with a letter (U, M or A) on them?”">​</a></h3><details><summary>Answer</summary><p>This is due to your content settings. Check out the <a href="./guides/content-settings">Content Settings Guide</a> for instructions on how to change this.</p><div align="center"><img src="'+h+'" alt="Blurred Covers" width="300"></div></details><h3 id="are-there-any-western-comic-extensions" tabindex="-1">Are there any Western Comic extensions? <a class="header-anchor" href="#are-there-any-western-comic-extensions" aria-label="Permalink to “Are there any Western Comic extensions?”">​</a></h3><details><summary>Answer</summary><p>Currently, Inkdex does not provide any Western Comic extensions. However, the Batcave, ReadAllComics, and ReadComicsOnlineRu extensions can be found in other repositories not maintained by Inkdex. Head over to our <a href="https://discord.gg/inkdex" target="_blank" rel="noreferrer">Discord server</a> for more information!</p></details><h3 id="what-are-the-best-extensions-to-install" tabindex="-1">What are the best extensions to install? <a class="header-anchor" href="#what-are-the-best-extensions-to-install" aria-label="Permalink to “What are the best extensions to install?”">​</a></h3><details><summary>Answer</summary><p>This is a highly subjective question which we often won&#39;t have an answer for. You can check other sites like <a href="https://everythingmoe.com" target="_blank" rel="noreferrer">everythingmoe.com</a> which try to answer this question as best as possible.</p></details><h3 id="does-site-x-have-an-extension" tabindex="-1">Does site X have an extension? <a class="header-anchor" href="#does-site-x-have-an-extension" aria-label="Permalink to “Does site X have an extension?”">​</a></h3><details><summary>Answer</summary><p>The easiest way to check this is through the <a href="/extension-list">Extension List page</a> on this website.</p></details><h3 id="what-extension-has-title-x" tabindex="-1">What extension has title X? <a class="header-anchor" href="#what-extension-has-title-x" aria-label="Permalink to “What extension has title X?”">​</a></h3><details><summary>Answer</summary><p>We don&#39;t know this either. We recommend searching the internet for your title to find which site hosts it, and then checking if that site has an extension.</p></details><h3 id="how-do-i-request-an-extension" tabindex="-1">How do I request an extension? <a class="header-anchor" href="#how-do-i-request-an-extension" aria-label="Permalink to “How do I request an extension?”">​</a></h3><details><summary>Answer</summary><p>Extension requests are submitted through the <code>/request-extension</code> <a href="https://support-apps.discord.com/hc/en-us/articles/26501837786775-Slash-Commands-FAQ" target="_blank" rel="noreferrer">slash command</a> in our <a href="https://discord.gg/inkdex" target="_blank" rel="noreferrer">Discord server</a>.</p><p>It will ask you for a valid URL (starts with &quot;https://&quot;) of the site in question and a reason as to why it should be turned into an extension.</p></details><h3 id="why-has-my-request-for-an-extension-not-been-added-yet" tabindex="-1">Why has my request for an extension not been added yet? <a class="header-anchor" href="#why-has-my-request-for-an-extension-not-been-added-yet" aria-label="Permalink to “Why has my request for an extension not been added yet?”">​</a></h3><details><summary>Answer</summary><p>Extension requests are never certain to be fulfilled. The requests are there to help extension developers discover wanted extensions.</p><p>If you want your extension to be added, your best chances are:</p><ul><li>Request an extension that is original and qualitative.</li><li>Build it yourself (check our <a href="/development/extensions">Extension Development Guide</a>; coding experience is good to have but not required).</li></ul><p>Most titles are already available through existing extensions. Creating a new extension simply to avoid waiting a short time for another site to update is not worth it for most developers. Since there are only a few active extension developers, foreign language extensions are less likely to get added.</p></details><h3 id="are-external-repositories-extensions-safe-to-use" tabindex="-1">Are external repositories/extensions safe to use? <a class="header-anchor" href="#are-external-repositories-extensions-safe-to-use" aria-label="Permalink to “Are external repositories/extensions safe to use?”">​</a></h3><details><summary>Answer</summary><p>All repositories/extensions provided by Inkdex are well maintained to ensure they are safe to use. Their code and release methods are open source, meaning you can inspect them on <a href="https://github.com/inkdex" target="_blank" rel="noreferrer">GitHub</a>.</p><p>In our <a href="https://discord.gg/inkdex" target="_blank" rel="noreferrer">Discord server</a>, you will be able to find other repositories which are not maintained by Inkdex and thus do not have the same guarantees; however, in general, extensions cannot do harm to your device. If you are doubtful about a certain extension, don&#39;t use it, or check its source code on its respective GitHub repository.</p></details><h3 id="is-there-any-copyrighted-material-hosted" tabindex="-1">Is there any copyrighted material hosted? <a class="header-anchor" href="#is-there-any-copyrighted-material-hosted" aria-label="Permalink to “Is there any copyrighted material hosted?”">​</a></h3><details><summary>Answer</summary><p>Inkdex does not host or distribute any content for which it does not hold the rights.</p><p>Extensions are simply scripts that pull content from other sites that may host these items. This means that extensions themselves do not contain copyrighted content, but the websites they access might.</p><p>The Inkdex project is in no way affiliated with any of the websites its extensions may access.</p></details><h3 id="how-do-i-filter-out-duplicate-chapters" tabindex="-1">How do I filter out duplicate chapters? <a class="header-anchor" href="#how-do-i-filter-out-duplicate-chapters" aria-label="Permalink to “How do I filter out duplicate chapters?”">​</a></h3><details><summary>Answer</summary><p>Some titles may have several chapter groups, resulting in duplicate versions of the same chapter.</p><p>You can configure Paperback to limit this to one version per chapter:</p><ul><li>Open the title view so that the chapter list is displayed.</li></ul><ul><li>Tap the <em>ellipsis icon (...)</em> → <strong><em>Manage Version Priority</em></strong>.</li></ul><div align="center"><img src="'+d+'" alt="Chapter List Ellipsis" width="300"></div><div align="center"><img src="'+m+'" alt="Ellipsis Menu Pop-Up - Manage Version Priority" width="300"></div><ul><li>A page titled <strong>Title Settings</strong> will open.</li></ul><div align="center"><img src="'+g+'" alt="Title Settings" width="300"></div><ul><li>In the section titled <strong>Available Versions</strong>, tap one or more groups to move them up to the <strong>Prioritised Versions</strong> section.</li></ul><div align="center"><img src="'+c+'" alt="Title Settings - PRIORITISED VERSIONS" width="300"></div><ul><li>If you have more than one group in the <strong>Prioritised Versions</strong> section, you can long-press the hamburger icon and drag to reorder them. The order determines the priority used for selecting chapter versions.</li></ul><div align="center"><img src="'+u+'" alt="Title Settings - PRIORITISED VERSIONS Order" width="300"></div><ul><li>If you enable the <strong>Hide Other Versions</strong> setting, it will only display those listed in the <strong>Prioritised Versions</strong> section. It will display another group only if those in <strong>Prioritised Versions</strong> do not have that specific chapter available.</li></ul><div align="center"><img src="'+p+'" alt="Hide Other Versions Setting" width="300"></div></details><h2 id="specific-extensions" tabindex="-1">Specific Extensions <a class="header-anchor" href="#specific-extensions" aria-label="Permalink to “Specific Extensions”">​</a></h2><h3 id="bato-to-or-mangaplus-how-do-i-remove-titles-in-other-languages" tabindex="-1">Bato.To or MangaPlus - How do I remove titles in other languages? <a class="header-anchor" href="#bato-to-or-mangaplus-how-do-i-remove-titles-in-other-languages" aria-label="Permalink to “Bato.To or MangaPlus - How do I remove titles in other languages?”">​</a></h3><details><summary>Answer</summary><ul><li>Tap the <em>cog icon</em> → <strong><em>Settings</em></strong> → <strong><em>Extensions</em></strong>. <ul><li>iOS: </li><li>macOS/iPadOS:</li></ul></li></ul><div align="center"><img src="'+e+'" alt="Settings Cog (macOS/iPadOS)" width="300"></div><div align="center"><img src="'+t+'" alt="Settings - Extensions" width="300"></div><ul><li>Tap the extension whose language settings you wish to adjust.</li><li>Tap <strong><em>Settings</em></strong> → <strong><em>Languages</em></strong>.</li><li>Select the language(s) you want to read; a tick will appear next to them.</li></ul></details><h3 id="mangadex-or-mangafire-how-do-i-remove-titles-in-other-languages" tabindex="-1">MangaDex or MangaFire - How do I remove titles in other languages? <a class="header-anchor" href="#mangadex-or-mangafire-how-do-i-remove-titles-in-other-languages" aria-label="Permalink to “MangaDex or MangaFire - How do I remove titles in other languages?”">​</a></h3><details><summary>Answer</summary><ul><li>Tap the <em>cog icon</em> → <strong><em>Settings</em></strong> → <strong><em>Extensions</em></strong>. <ul><li>iOS: </li><li>macOS/iPadOS:</li></ul></li></ul><div align="center"><img src="'+e+'" alt="Settings Cog (macOS/iPadOS)" width="300"></div><div align="center"><img src="'+t+'" alt="Settings - Extensions" width="300"></div><ul><li>Tap the extension whose language settings you wish to adjust.</li><li>Tap <strong><em>Settings</em></strong> → <strong><em>Content Settings</em></strong> → <strong><em>Languages</em></strong>.</li><li>Select the language(s) you want to read; a tick will appear next to them.</li></ul></details><h3 id="mangadex-why-are-some-titles-chapters-available-on-the-site-not-showing-in-paperback" tabindex="-1">MangaDex - Why are some titles/chapters available on the site not showing in Paperback? <a class="header-anchor" href="#mangadex-why-are-some-titles-chapters-available-on-the-site-not-showing-in-paperback" aria-label="Permalink to “MangaDex - Why are some titles/chapters available on the site not showing in Paperback?”">​</a></h3><details><summary>Answer</summary><p>There are two common reasons for this:</p><ol><li><strong>MangaDex itself is filtering content.</strong></li></ol><ul><li>Tap the <em>cog icon</em> → <strong><em>Settings</em></strong> → <strong><em>Extensions</em></strong>. <ul><li>iOS: </li><li>macOS/iPadOS:</li></ul></li></ul><div align="center"><img src="'+e+'" alt="Settings Cog (macOS/iPadOS)" width="300"></div><div align="center"><img src="'+t+'" alt="Settings - Extensions" width="300"></div><ul><li>Tap <strong><em>MangaDex</em></strong>.</li><li>Tap <strong><em>Settings</em></strong> → <strong><em>Content Settings</em></strong> → <strong><em>Content Rating</em></strong>.</li></ul><ol start="2"><li><strong>The chapters are not hosted on MangaDex, but instead link to external sites.</strong></li></ol><ul><li>Open the title in Paperback.</li><li>If the title is hosted externally, you will see the following error:</li></ul><div class="danger custom-block"><p class="custom-block-title">An error occurred</p><p>A Javascript error occurred: Chapters are hosted externally outside MangaDex, you will need to use another source or read it online.</p></div></details><h3 id="mangabox-themed-sites-why-do-pages-have-gaps-or-splits-on-the-displayed-pages" tabindex="-1">MangaBox-themed sites - Why do pages have gaps or splits on the displayed pages? <a class="header-anchor" href="#mangabox-themed-sites-why-do-pages-have-gaps-or-splits-on-the-displayed-pages" aria-label="Permalink to “MangaBox-themed sites - Why do pages have gaps or splits on the displayed pages?”">​</a></h3><details><summary>Answer</summary><p>MangaBox-themed sites (e.g., Manganato, Mangakakalot, MangaBat) have switched from paged chapters to long vertical strips, cropping images in irregular sizes.</p><p>Trying to read titles from these extensions with the horizontal reader will cause them to display improperly; this is not something that can be fixed at this moment.</p><p>The only available fix is to always use Paperback&#39;s vertical reader without page padding when reading titles from these extensions.</p></details>',35)])])}const _=i(x,[["render",y]]);export{P as __pageData,_ as default};
